# 场景示例

filterPopover 配合 sortable（boolean 类型触发后端接口，CompareFn 前端排序函数），进行前端筛选 + 排序：

```plain
get columns() {
    return [
      { name: 'userid', filter: true, sortable: true },
      { 
        name: 'name', 
        editor: true,
        filter: ({record,filterText}) => filterText === '1' & record.get('name') === '孟艳',
      },
      { 
        name: 'age', 
        editor: true, 
        sortable: (a, b, s) => { 
          return s === 'asc' ? (a.get( 'age') - b.get('age')) : (b.get('age') - a.get('age'));
        } 
      },
      { name: 'sex', editor: true },
      { 
        name: 'enable', 
        editor: true,
        filter: true,
        filterPopover: ({setFilterText, footer}) => {
          return (
                <>
                    <Button icon="playlist_add" onclick={() => setFilterText(true)} key="add">true</Button>
                    {footer}
                </>
            );
        },
      },
    ];
  }
